// src/AboutCard.js
import React from 'react';
import './styles/Abouttable.css'; // Asegúrate de que la ruta sea correcta

const AboutCard = ({ data }) => {
  return (
    <div className="card-container">
      {data.map(item => (
        <div key={item.id} className="card" style={{ backgroundColor: item.colour }}>
          <img src={item.img} alt={item.header} className="card-image" />
          <h3 className="card-header">{item.header}</h3>
          <p className="card-body">{item.body}</p>
        </div>
      ))}
    </div>
  );
};

export default AboutCard;
